import React from "react";

export const Filter_Option_Selector = (props) => {

    const Appending_Keyword = () => {

        const Added_Option = document.getElementById(`AddedOption_${props.option}`)

        const Added_Keyword = document.createElement('input')
        Added_Keyword.className = 'AddedKeyword'

        Added_Option.append(
            Added_Keyword    
        )

    }

    return <React.Fragment>

        <div className="OptionSelector">

            <span className="OptionRepresented">{props.option}</span>
            
            <br></br>
            <div id={`AddedOption_${props.option}`}></div>
            <div className="OptionSelector_Button" onClick={()=>{

                        Appending_Keyword()

            }}>+</div>

        </div>

    </React.Fragment>

}

export default Filter_Option_Selector
